void draw_background(){
    for (int x = 0; x <= 319; x++){
        for(int y = 0; y <= 239; y++){
            if((x >= 77 && x <= 80) ||  (x >= 154 && x <= 163) || (x >= 237 && x <= 240))
            plot_pixel(x, y, 0xF47E);
            else{
                plot_pixel(x, y, 0x0824);
            }
        }
    }
}

void draw_red_car(){
    int i = 0;
    for(int y = 150; y < 190; y++){
        for (int x = 22; x < 58; x++){
            plot_pixel(x, y, (red_car[i] | red_car[i+1] << 8));
            i+=2;
        }
    }
}

void draw_blue_car(){
    int i = 0;
    for(int y = 150; y < 190; y++){
        for (int x = 262; x < 298; x++){
            plot_pixel(x, y, (blue_car[i] | blue_car[i+1] << 8));
            i+=2;
        }  
    }
}

void draw_title(){
    int i = 0;
    for(int y = 64; y < 112; y++){
        for (int x = 89; x <= 229; x++){
            plot_pixel(x, y, (two_cars_title[i] | two_cars_title[i+1] << 8));
            i+=2;
        }
    }
}

void clear_screen(){
    for (int x = 0; x <= 319; x++){
        for(int y = 0; y <= 239; y++){
            plot_pixel(x, y, 0xFFFF);
        }
    }
}

void draw_rectangle(int x_box, int y_box, short int colour_box){

    for(int i = -1; i <=1 ; i++){
        for(int j = -1; j <=1 ; j++){
            if((x_box + i) < 319 && (x_box + i) >= 0 && (y_box + j) < 239 && (y_box + j) >= 0)
            plot_pixel(x_box +i, y_box+j, colour_box);
        }
    }
}

void draw_line(int x0, int y0, int x1, int y1, short int colour)
{
    // int y_diff = y1 - y0;
    // y_diff = y_diff > 0 ? y_diff : (y_diff * -1);

    // int x_diff = x1 - x0;
    // x_diff = x_diff > 0 ? x_diff : (x_diff * -1);

    bool isSteep = abs(y1- y0) > abs(x1- x0);
    //bool isSteep = y_diff > x_diff ? true : false;

    if(isSteep){
        swap(&x0, &y0);
        swap(&x1, &y1);
    }

    if(x0 > x1){
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int delta_x = x1 - x0;

    //y_diff = y1 - y0;
    //int delta_y= y_diff > 0 ? y_diff : (y_diff * -1);
	int delta_y= abs(y1-y0);
    int error = -(delta_x/2);
    int y = y0;

    int y_step = 1;
    if(y0 >= y1){
        y_step = -1;
    }

    for(int x = x0; x<= x1; x++){
        if(isSteep)
            plot_pixel(y, x, colour);
        else 
            plot_pixel(x, y, colour);
        error = error + delta_y;

        if(error >=0){
            y = y+ y_step;
            error = error - delta_x;
        }
    }
}

void swap (int* a, int* b){
    int temp = *a;
    *a = *b;
    *b = temp;
}
	
void wait_for_vsync(){
    register int status;
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    *pixel_ctrl_ptr = 1;

    status = *(pixel_ctrl_ptr + 3);
    while((status & 0x01)!=0){
        status = *(pixel_ctrl_ptr +3);
    }
}


void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void checkBounds(int x_box, int y_box, int *dx_box, int *dy_box){
    if(x_box == 319 || x_box == 1){
        *dx_box = *dx_box * -1;
    }
    if(y_box == 239 || y_box == 1){
        *dy_box = *dy_box * -1;
    }
}
